      monsters:[],

  };
}

componentDidMount() {
  fetch('https://jsonplaceholder.typicode.com/users')
    .then((response) => response.json())
    .then((users) => this.setState(() =>
   { return {monsters:users};
}))
}

  render(){
    return (
      <div className="App">
        <div className = "Monsters">
         {this.state.monsters.map(
          (monster) => {
            return (
            <div key={monster.id}>
              <h1>{monster.name}</h1>
              </div>
            )
          }
         )

         }
        </div>

      </div>
    )
  }

}

export default App;
